import React from "react";
import styled from "styled-components";

const Trusted = () => {
  return (
    <>
      <Wrapper>
        <div className="trusted_portion">
          <div className="container">
          <p>trusted by 100+ companies</p>
            <div className="brand_section">
              <div className="brand_section_img">
                <img className="grayscale" src="./images/a.png" />
              </div>

              <div className="brand_section_img">
                <img className="grayscale" src="./images/alibaba.png" />
              </div>
              <div className="brand_section_img">
                <img className="grayscale" src="./images/c.png" />
              </div>
              <div className="brand_section_img">
                <img className="grayscale" src="./images/x.png" />
              </div>
              <div className="brand_section_img">
                <img className="grayscale" src="./images/x2.png" />
              </div>
            </div>
          </div>
        </div>
      </Wrapper>
    </>
  );
};
const Wrapper = styled.section`
  padding: 9rem 0;
  .trusted_portion {
    background: ${({ theme }) => theme.colors.bg};
    width: 100%;
    height: 15rem;

    p {
      padding-top: 2rem;
      text-align: center;
      text-transform: capitalize;
      font-size: 1.6rem;
    }
    .brand_section {
      gap: 10rem;
      display: flex;
      align-items: center;
      justify-content: space-around;
      flex-direction: row;
      margin: 0rem 16rem 0rem 16rem;
    }
    .brand_section_img {
      img {
        width: 6rem;
        height: 5rem;

        .grayscale {
          filter: grayscale(100%);
        }
      }
    }
  }

  @media (max-width: ${({ theme }) => theme.media.tab}) {
    .trusted_portion {
    background: ${({ theme }) => theme.colors.bg};
    width: 100%;
    height: 15rem;
    .brand_section {
      gap: 4rem;
      display: flex;
      align-items: center;
      justify-content: space-around;
      flex-direction: row;
      margin: 0rem 16rem 0rem 16rem;
    }
    }
  }

  @media (max-width: ${({ theme }) => theme.media.mobile}) {
    .trusted_portion {
    background: ${({ theme }) => theme.colors.bg};
    width: 100%;
    height: 15rem;
    .brand_section {
      gap: 4rem;
      display: flex;
      align-items: center;
      justify-content: space-around;
      flex-direction: row;
      margin: 0rem 16rem 0rem 16rem;
    }
    }
  }

  @media (max-width: ${({ theme }) => theme.media.small_phone}) {
    .trusted_portion {
    background: ${({ theme }) => theme.colors.bg};
    width: 100%;
    height: 15rem;
    .brand_section {
      gap: 1rem;
      display: flex;
      align-items: center;
      justify-content: space-around;
      flex-direction: row;
      margin: 0rem 16rem 0rem 16rem;
    }
    }
  }


`;
export default Trusted;
